const ItemDetail = ({product}) => {
    return(
        
        <div className="productsContainer">
            <div className="ItemDetailStyle">
            <img src = {product?.img}/>
                <div className="ItemDetailStyle_footer">
                <h1>{product?.name}</h1>
                <p>{product?.color}</p>
                <p>${product?.price}</p>
                <button type="submit">Add To Cart</button>

                </div>
            </div>
            
        </div>
            
        
    );
};

export default ItemDetail;
